<div class="item_info_section">
<p> Принтер документов FPrint-22 для ЕНВД. Белый. RS&#43;USB.</p>
<p>Принтер документов для ЕНВД FPrint-22 станет лучшим решением кассовой печати для предприятий, работающих по схеме налогообложения ЕНВД. Устройство воплощает все преимущества принтеров документов для ЕНВД перед принтерами чеков: в любой момент доступна доработка до фискального регистратора; привычная сменная логика работы; финансовый контроль за счет использования фискальной памяти.<br />
<br />
FPrint-22 печатает на любой чековой ленте. Поддерживает печать на чековой ленте шириной 80 мм, 57 мм и 44 мм. Благодаря разделителю, идущему в комплекте, лента при любой ширине всегда будет размещена правильно. <br />
<br />
Принтер имеет общую с FPrint-55 электронную плату. Он позволяет также оптимизировать хранение ЗИП. Электронная часть проверена временем и опытом использования &#40;более 5 тысяч работающих устройств&#41;. Процесс обслуживания этих аппаратов привычен для мастеров ЦТО.<br />
<br />
В FPrint-22 используется новый печатающий механизм с автоматическим отрезчиком и максимальной шириной печати 80 мм CAPD-347B. В этом механизме представлена уникальная технология, позволяющая полностью избавиться от заклинивания ножей автоматического отрезчика.<br />
<br />
Аналогично модели FPrint-55, все основные настройки реализуются с помощью специального режима и управления кнопкой промотки бумаги. В FPrint-22 настройки стали еще более наглядными благодаря добавленной интерактивности.<br />
</p></div>
